import React from 'react'
import Search from '../PageComponents/Index/Search'
import SwiperCards from '../PageComponents/Index/SwiperCards'
import AvaliableJobs from '../PageComponents/Index/AvaliableJobs'
import { useEffect,useState } from 'react'
function Index() {

  const [inputValue, setInputValue] = useState("");

  useEffect(() => {
    // Write something after 2 seconds
    const timeoutId = setTimeout(() => {
      setInputValue("Hello, World!"); // Set the input value
      setTimeout(() => {
        setInputValue(""); // Clear the input value after 2 seconds
      }, 2000);
    }, 2000);

    // Clean up the timeout to avoid memory leaks
    return () => clearTimeout(timeoutId);
  }, []); // Run only once after component mounted

  const handleChange = (event) => {
    setInputValue(event.target.value);
  };
  return (
    <div>
